ru.urururu.cmakeedit.ArgumentNode.argument:
if(\"${hg_tag}\" STREQUAL \"\") message(FATAL_ERROR \"Tag for hg checkout should not be empty.\") endif()
set(run 0)
if(\"${hgclone_infofile}\" IS_NEWER_THAN \"${hgclone_stampfile}\") set(run 1) endif()
if(NOT run) message(STATUS \"Avoiding repeated hg clone, stamp file is up to date: '${hgclone_stampfile}'\") return() endif()
execute_process( COMMAND \${CMAKE_COMMAND} -E remove_directory \"${source_dir}\" RESULT_VARIABLE error_code ) if(error_code) message(FATAL_ERROR \"Failed to remove directory: '${source_dir}'\") endif()
execute_process( COMMAND \"${hg_EXECUTABLE}\" clone -U \"${hg_repository}\" \"${src_name}\" WORKING_DIRECTORY \"${work_dir}\" RESULT_VARIABLE error_code ) if(error_code) message(FATAL_ERROR \"Failed to clone repository: '${hg_repository}'\") endif()
execute_process( COMMAND \"${hg_EXECUTABLE}\" update ${hg_tag} WORKING_DIRECTORY \"${work_dir}/${src_name}\" RESULT_VARIABLE error_code ) if(error_code) message(FATAL_ERROR \"Failed to checkout tag: '${hg_tag}'\") endif()
# Complete success, update the script-last-run stamp file: # execute_process( COMMAND \${CMAKE_COMMAND} -E copy \"${hgclone_infofile}\" \"${hgclone_stampfile}\" WORKING_DIRECTORY \"${work_dir}/${src_name}\" RESULT_VARIABLE error_code ) if(error_code) message(FATAL_ERROR \"Failed to copy script-last-run stamp file: '${hgclone_stampfile}'\") endif()

if(\${make} MATCHES \"^/\")
  execute_process(
    COMMAND cygpath -w \${make}
    OUTPUT_VARIABLE cygpath_make
    ERROR_VARIABLE cygpath_make
    RESULT_VARIABLE cygpath_error
    OUTPUT_STRIP_TRAILING_WHITESPACE
  )
  if(NOT cygpath_error)
    set(make \${cygpath_make})
  endif()
endif()
